import TextEditor from './components/TextEditor'
import {
  BrowserRouter,
  Routue,
  Redirect,
  Route
} from 'react-router-dom';
import {v4 as uniqueId} from 'uuid';

function App() {
  return (
    <BrowserRouter>
      <Routue>
        <Route path="/" exact>
          <Redirect to={`/documents/${uniqueId()}`}/>
        </Route>
        <Route path="/documents/:id" exact>
          <Redirect to={<TextEditor/>} />
        </Route>
      </Routue>
    </BrowserRouter>
  );
}

export default App;
